import { Component } from '@angular/core';

@Component({
  selector: 'app-navigation',
  templateUrl: './navigation.component.html',
  styleUrls: ['./navigation.component.css']
})
export class NavigationComponent {
navItems = [
  {displayName: "Client Portal",
   pathName: "client-portal"},
   {displayName: "Reports Portal",
   pathName: "reports-portal"},
   {displayName: "Maps Portal",
   pathName: "maps-portal"},
   {displayName: "Log Out",
   pathName: "logout"}
];


}

<div class="row">
  <div class="col-xs-10 list-group">
    <a  *ngFor="let navItem of navItems; let i=index" class="col list-group-item clearfix p-1" style="cursor: pointer; text-align: center;" routerLink="/{{navItem.pathName}}" routerLinkActive="active">
      <p class="list-group-item-text" >{{ navItem.displayName }}</p>
    </a>
  </div>
</div>
